	add("smoko", "{\"term\":\"smoko\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|smoke|o|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A cigarette break from work or military duty; a brief cessation of work to have a smoke, or (more generally) to take a small rest, snack etc\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1985\u0027\u0027, \u0027Illywhacker\u0027, Faber and Faber 2003, p. 516\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"We saw the innards of a submarine, and afterwards, at \u0027\u0027smoke-oh\u0027\u0027, I entertained the men with my story of the bagman\u0027s battle with John Oliver O\u0027Dowd\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Lexie Simmons, Darrell Lewis, \u0027Kajirri, the Bush Missus\u0027, Central Queensland University Press, %22smokos%22|%22smokoes%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003dVVwQePFfKN\u0026amp;sig\u003dwKKI-htGkw1x7h0BJPj5IRpWz0k\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dGRhTULzcN_HomAXTgIG4CA\u0026amp;redir_esc\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"%22smokos%22|%22smokoes%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 16\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"This area was the general meeting place for all the Aboriginal workers who had some time to spare. The house girls took their \u0027\u0027smoko\u0027\u0027 or lunch there and were soon joined by everyone else who′d stopped work after the \u0027\u0027smoko\u0027\u0027 or lunchtime bell\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Lewis Yerloburka O′Brien, Mary-Ann Gale (transcriber), \u0027And the Clock Struck Thirteen: The Life and Thoughts of Kaurna Elder Uncle Lewis Yerloburka O′Brien as told to Mary-Ann Gale\u0027, %22smokos%22|%22smokoes%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003dCgGwn5cpqu\u0026amp;sig\u003dAg10Jkw9P7wpqQih8xCkjhzQ2kU\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dGRhTULzcN_HomAXTgIG4CA\u0026amp;redir_esc\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"%22smokos%22|%22smokoes%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 163\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"One day Ox-head came up to us during \u0027\u0027smoko\u0027\u0027 to have a yarn and to help himself to some lollies another bloke, Seth, had bought\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Ann Jones, \u0027Put the Billy On\u0027, Glass House Books, Australia, %22smokos%22|%22smokoes%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003dAG1JzQG6YJ\u0026amp;sig\u003dZ8Hc3NAObaCId_SFjY3jgUKCzJI\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dGRhTULzcN_HomAXTgIG4CA\u0026amp;redir_esc\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"%22smokos%22|%22smokoes%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 85\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"‘You chaps should have a camp this afternoon,’ Dad suggested as they finished their meal. ‘You must be tired out. There′s a couple of stretchers upstairs along the verandah. Have a camp on those and we′ll wake you for \u0027\u0027smoko\u0027\u0027,’ and the party dispersed until the bell was rung\", \"priority\":12}]}, \"synonyms\":{}}");

