	add("smoothie", "{\"term\":\"smoothie\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|smooth|ie|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A smooth-talking person\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Michael Lydon, \u0027Flashbacks: Eyewitness Accounts of the Rock Revolution, 1964-1974\u0027 (page 7\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"True to their reputations, Paul was a \u0027\u0027smoothie\u0027\u0027 who put a public relations gloss on everything he said, and John was abrasive and sarcastic, speaking his mind and letting the chips fall where they may\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A drink made from whole fruit, thus thicker than fruit juice\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A member of the mod subculture who is relatively non-violent and wears expensive clothing\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1987\u0027\u0027, John Irwin (quoting Piri Thomas), \u0027The Felon\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The decision to cool myself made the next two years the hardest I had done because it meant being a \u0027\u0027smoothie\u0027\u0027 and staying out of trouble, which in prison is difficult\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, Nick Johnstone, \u0027Abel Ferrara: The King of New York\u0027 (page viii\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Film Comment\u0027s David Chute described him as: \u0026quot;small, stringy and intense, but he\u0027s better dressed and groomed (than Ferrara), less of a punk and more of a \u0027\u0027smoothie\u0027\u0027.\u0026quot\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Gerard DeGroot (quoting Brown), \u0027Seventies Unplugged\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"mods, skins, suedes, \u0027\u0027smoothies\u0027\u0027, punks, skunks, rude boys, soul boys and headbangers\", \"priority\":11}]}, \"synonyms\":{}}");

	add("smorat", "{\"term\":\"smorat\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027Tricholoma Smoraticus\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A fungal entity, containing 106 pairs of chromosomes, all of equal length. Found in sulphurous sea basins at a depth of between 500 and 700 meters along the Pacific rift. Discovered by the noted marine biologist Dr McBride in May 1956\", \"priority\":1}]}, \"synonyms\":{}}");

	add("smorgasbord", "{\"term\":\"smorgasbord\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Swedish\"], \"text\":\"From Swedish \u0027smörgåsbord\u0027 (buffet with many small dishes) from \u0027smörgås\u0027 (sandwich) + \u0027bord\u0027 (table)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A buffet\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1965\u0027\u0027, California Bureau of Food and Drug Inspections, \u0027Recommendations for Food Protection Devices: Cafeterias, Buffets, Chuck Wagons, \u0027\u0027Smorgasbords\u0027\u0027\u0027, [http://books.google.com.au/books?id\u003dtaI6AQAAIAAJ\u0026amp;q\u003d%22smorgasbord%22%7C%22smorgasbords%22\u0026amp;dq\u003d%22smorgasbord%22%7C%22smorgasbords%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dKKXJUZvmKs-fiQfIxYDIBw\u0026amp;redir_esc\u003dy page 1\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Cafeterias, buffets, chuck wagon service and \u0027\u0027smorgasbords\u0027\u0027 are becoming increasingly popular food service methods\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Pete Helland, \u0027Thanks to God for the \u0027\u0027Smorgasbord\u0027\u0027\u0027, Jeff Pepper, \u0027Daily Triumph\u0027, [http://books.google.com.au/books?id\u003devaq_CzA5jgC\u0026amp;pg\u003dPA15\u0026amp;dq\u003d%22smorgasbord%22%7C%22smorgasbords%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dKKXJUZvmKs-fiQfIxYDIBw\u0026amp;redir_esc\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22smorgasbord%22%7C%22smorgasbords%22\u0026amp;f\u003dfalse page 15\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"It is a \u0027\u0027smorgasbord\u0027\u0027. That means that after you pay a certain amount of money for your meal you can eat anything you want, together with as much as you want. I remember the first time my folks took me to a \u0027\u0027smorgasbord\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Darwin Porter, Danforth Prince, Roger Norum, \u0027Frommer\u0027s Scandinavia\u0027, [http://books.google.com.au/books?id\u003dNEcXtIx2ZPEC\u0026amp;pg\u003dPA17\u0026amp;dq\u003d%22smorgasbord%22%7C%22smorgasbords%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dKKXJUZvmKs-fiQfIxYDIBw\u0026amp;redir_esc\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22smorgasbord%22%7C%22smorgasbords%22\u0026amp;f\u003dfalse page 17\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The fame of the smörgåsbord (\u0027\u0027smorgasbord\u0027\u0027) is justly deserved. Using a vast array of dishes—everything from Baltic herring to smoked reindeer—the \u0027\u0027smorgasbord\u0027\u0027 (never served in the evening) can be eaten either as hors d\u0027oeuvres or as a meal in itself\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A diverse collection of things\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Nicholas Ayo, \u0027Times of Grace: Spiritual Rhythms of the Year at the University of Notre Dame\u0027, [http://books.google.com.au/books?id\u003dSHHHaK4Ma14C\u0026amp;pg\u003dPA59\u0026amp;dq\u003d%22smorgasbord%22%7C%22smorgasbords%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dKKXJUZvmKs-fiQfIxYDIBw\u0026amp;redir_esc\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22smorgasbord%22%7C%22smorgasbords%22\u0026amp;f\u003dfalse page 59\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Here is the \u0027\u0027smorgasbord\u0027\u0027 of life, and our unfocused eyes are even bigger than our stomachs\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Lorena Bathey, \u0027Happy Beginnings: How I Became My Own Fairy Godmother\u0027, [http://books.google.com.au/books?id\u003dg64U0x0Vv7UC\u0026amp;pg\u003dPT45\u0026amp;dq\u003d%22smorgasbord%22%7C%22smorgasbords%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dKKXJUZvmKs-fiQfIxYDIBw\u0026amp;redir_esc\u003dy unnumbered page\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"It appeared to me that this sexual \u0027\u0027smorgasbord\u0027\u0027 was a way for these women to feel something again\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Charles Hanly, \u0027Chapter Seven: Logic, Meaning and Truth in Psychoanalytic Research\u0027, Jorge Canestri, Marianne Leuzinger-Bohleber, Mary Target (editors), \u0027Early Development and its Disturbances\u0027, [http://books.google.com.au/books?id\u003dymrmFS6gMLgC\u0026amp;pg\u003dPA211\u0026amp;dq\u003d%22smorgasbord%22%7C%22smorgasbords%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dgKzJUdueH6m5iQfb1YDIDg\u0026amp;redir_esc\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22smorgasbord%22%7C%22smorgasbords%22\u0026amp;f\u003dfalse page 211\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"As such, and unlike philosophy which has toyed with this self-definition, it is not good enough for psychoanalysis to be a \u0027\u0027smorgasbord\u0027\u0027 of alternative ways of interpreting human nature. The \u0027\u0027smorgasbord\u0027\u0027 of available therapies is already heavily laden with alternative psychotherapies without psychoanalysis adding further varieties of its own\", \"priority\":18}]}, \"synonyms\":{}}");

	add("smoxploitation", "{\"term\":\"smoxploitation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|smoke|sploitation|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A genre of fetish films which do nothing but show a person smoking a cigarette\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1998\u0027\u0027, Sharon Bohn Gmelch, \u0027Gender on Campus: Issues for College Women\u0027, Rutgers University Press (1998), ISBN 9780813525211, [http://books.google.com/books?id\u003dwoWrlr64OJwC\u0026amp;pg\u003dPA178 page 178\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"quot;\u0027\u0027Smoxploitation\u0027\u0027\u0026quot; films with titles like \u0027Smoky Kisses\u0027 and \u0027Sorority Girls Smoke\u0027 now exist that show nothing but conventionally attractive (what else?) women smoking\", \"priority\":3}]}, \"synonyms\":{}}");

